    def __init__(self, sd: RestAPI):
        self.sd = sd
        self.type_map['address'] = self._make_address_model(self.address_md_template)

    @staticmethod
    def to_snake_case(name):
        name = re.sub('(.)([A-Z][a-z]+)', r'\1_\2', name)
        name = re.sub('__([A-Z])', r'_\1', name)
        name = re.sub('([a-z0-9])([A-Z])', r'\1_\2', name)
        return name.lower()

    def make(self, sobject, sf_metadata=None):
        sf_metadata = sf_metadata or self.sd.get_metadata(sobject)[0]['fields']
        kwargs = {}
        for f in sf_metadata:
            name = f.get('name')
            cfg = {"alias": name}
            required = not f.get('nillable', True)
            cfg['type'] = Optional[self.type_map[f.get('type')]] if not required else self.type_map[f.get('type')]
            cfg['default'] = f.get('defaultValue', ...)

            if f.get('type') == 'string':
                cfg['max_length'] = f['length']

            if f.get('type') == 'int':
                cfg['max_digits'] = f.get('digits')
                cfg['decimal_places'] = 0

            if f.get('type') == 'double':
                cfg['max_digits'] = f.get('precision')
                cfg['decimal_places'] = f.get('scale')

            if f.get('picklistValues') and f.get('restrictedPicklist'):
                allowed_values = [t['value'] for t in f.get('picklistValues') if t['active']]
                cfg['type'] = Optional[Literal[tuple(allowed_values)]]

            kwargs[SalesforceModelFactory.to_snake_case(name)] = (cfg['type'], Field(**cfg))
        return create_model(sobject, **kwargs)

    def _generate_address_compound_metadata(self, src_obj='Account', field_prefix='Billing'):

        sf_metadata = self.sd.get_metadata(src_obj)[0]['fields']
        fields = []
        for f in sf_metadata:
            if f['compoundFieldName'] == f'{field_prefix}Address' and f['type'] != 'address':
                f['name'] = f['name'].replace(field_prefix, '')
                f['name'] = f['name'][0].lower() + f['name'][1:]
                fields.append(f)

        return fields

    def _make_address_model(self, fields):
        return self.make('Address', fields)